import React from 'react';
import '../assets/style/ChatService.css';

const ChatService = ({ onClose }) => {
  return (
    <div className="chat-service">
      <button className="back-button" onClick={onClose}>Back to Services</button>
      <div className="chat-messages">
        {/* Chat messages will be displayed here */}
      </div>
    </div>
  );
};

export default ChatService;
